import React from 'react';
import './imgcomp.css';

const ImgComp = ({src}) =>{
  const[wobble, setWobble] = React.useState(0);
  return <img className="image" src={src} alt="slide-img" onClick={() => setWobble(1)} onAnimationEnd={() => setWobble(0)} wobble={wobble}></img>;
}

export default ImgComp;
